import React from "react";
import GlobalStyle from "../../../../styles/Global.css";
import Input from '@mui/joy/Input';

const {Btn} = GlobalStyle

function Login() {

    

    return (
        <>
        <form action="POST">
            <p>Логин</p>
            <Btn type="submit">Login</Btn>
        </form>
        </>
    )
}

export default Login
